import React from 'react';
import {Component} from 'react';
import logo from '../pics/profilePhoto.jpg'

class DialogElement extends Component{
  render(){
    return(
      <div className="dialog">
        <div className="dialogProfileInfo">
          <img src="../static/src/profilePhoto.jpg" alt="PHOTO"/>
          <h4>Такса Сережа</h4>
        </div>
        <p className="message">{this.props.l}<span class='messageTime'>11:35</span></p>
      </div>
    )
  }
}


export default connect(
  state =>({
    dialogs :  state.dialogs
  }),
  dispatch =>({

  })
)(DialogElement)
